import './css/Turtle.css';
import React from 'react';
import { Link } from 'react-router-dom';

export default function Turtle() {
    return(
        <div>
            <div className='menu'>
                <p className='pageName'>거북이 수족관</p>
                <p className='logOut'>로그아웃</p>
                <div className='Turtle_Background'>                   
                    <Link to='/DeepSea'><img className='DeepSea_Link' alt='DeepSea'></img></Link>
                    <Link to='/Space'><img className='Space_Link' alt='Space'></img></Link>
                </div>  
            </div>
        </div>
    )
}
